from ast import literal_eval


def convert_size(size_bytes):
    # Size in bytes
    size_name = ["Bytes", "KB", "MB", "GB", "TB", "PB", "EB", "ZB", "YB"]
    i = 0
    while size_bytes >= 1024 and i < len(size_name) - 1:
        size_bytes /= 1024
        i += 1
    return f"{round(size_bytes, 2)} {size_name[i]}"


